import React from "react";
import Header from "./Header";
import "./Cart.css";

export default function Cart() {
    return(
        <>
            <Header/>
            <div className="cart-container">
                <h3>Your Items</h3>
                <ul className="product-list">
                    <li className="table-header">
                            <th>Product Name</th>
                            <th>Price</th>
                            <th>Quantity</th>
                            <th>Delete</th>
                    </li>
                </ul>


            </div>
        </>
    )
}
